import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';

const PostStyled = styled.div`
  flex: 1;
`;

const Post = ({
  postList,
  post,
}) => {
  console.log(post)
  return (
    <PostStyled>
    </PostStyled>
  );
};

Post.propTypes = {
  postList: PropTypes.array.isRequired,
  post: PropTypes.object.isRequired,
};

export default Post;
